INSERT INTO `v1_7b343fee00c248adffe718564d874e2ff48aa4c188f457932bd8019fdd16acbf` VALUES ("でも、楽しいお仕事ですぞ～♪\nできればもうすこ～し、\n魔法少女チックな要素を\n付け足せたらとは思ったけど……", 38612, 0.5, 101311, 1, 10, 1, 0, 11, 0, 38612031);
